func Or(predicates ...predicate.AssignmentSubmission) predicate.AssignmentSubmission {
	return predicate.AssignmentSubmission(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.AssignmentSubmission) predicate.AssignmentSubmission {
	return predicate.AssignmentSubmission(sql.NotPredicates(p))
}
